import { BrowserRouter, Routes, Route } from "react-router";

function App() {
  return <BrowserRouter>
    <Routes>
      <Route path="/" element={<h2>Hello Alvin</h2>}></Route>
    </Routes>
  </BrowserRouter>
}

export default App;
